import React,{Component} from 'react';
import axios from 'axios';


class Axioss extends Component{
    constructor(){
        super();
        this.state = {
            mydata:[]
        }
    }
    render(){
       
        return <div>
                   <input type="text"/>
                   <button onClick={this.onClickHandler}>Send</button>
               </div>
    }
}
export default Axioss;
